import React from "react";
let count = 1;
const App = () => {
  const incMent = () => {
    console.log("click" + count++);
  };
  return (
    <div>
      <h1>{count}</h1>
      <button onClick={incMent}>click me</button>
    </div>
  );
};

export default App;
